import React, {useEffect} from "react";
import {getallpokemons} from '../actions/actions'
import {useDispatch} from 'react-redux'

function Home(){
    const dispatch = useDispatch()
      useEffect(() =>{
          dispatch(getallpokemons())
        }
          ,[])
        return(
        <div className="">
            Home
        </div>
    )
}

export default Home;
